INSERT INTO `data_posts_twitter` VALUES ('1869220738168943061','xe scooter','mabeo2610','Mia¹³ | Jimin is my MUSE 🌈✨️','2024-12-18 10:18:47','0','1','/3157063051/status/1869220738168943061','@tauhucotdua Đâu chỉ đợi đến lúc cô xè ra nhạc, cno gáy như thế từ lúc thằng chuột mới thank you and take it from scooter and bang r. Ọt gõ phím chửi lão bang nhưng quên mất đéo có bang thì thằng chuột đ có cái lồn gì trong tay để mà solo vì đang mải ở nhà ôm gái rồi 😭','2025-05-15 10:40:23'),('1869746859797012839','xe scooter','news21925','THẾ GIỚI NEWS','2024-12-19 21:09:24','0','1','/1856178922834276353/status/1869746859797012839','Tướng Nga, trung tướng Igor Kirillov bị Ukraine ám sát giữa thủ đô Moscow, đã thiệt mạng hôm 17/12/24 trong một vụ nổ bom gắn trên chiếc xe scooter gần lối vào tòa chung cư.\n\nCục tình báo Ukraine (SBU) xác nhận với\nReuters rằng cơ quan này đứng sau vụ ám sát. https://t.co/0VQd3O1qVp','2025-05-15 10:40:23'),('1871004899527508096','xe scooter','TheRoses2022','the rose','2024-12-23 08:28:24','0','1','/2339558233/status/1871004899527508096','#Ukraine  \n\nLữ đoàn Azov 🇺🇦chống lại các kiểu tấn công của quân xâm lược Nga🇷🇺, từ xe tăng, xe gôn, xe điện, scooter... https://t.co/UFAON6PcJY','2025-05-15 10:40:23'),('1875459642559504506','xe scooter','kidsmovevn','Kidsmove - Thế giới xe của bé','2025-01-04 15:29:57','0','1','/1094474474/status/1875459642559504506','Mẹ bóc hộp chiếc xe scooter chòi chân Cooghi V3 màu xám. Món quà cho sự phát triển của con ❤️🥰\n\n#cooghi #xetruotscooter #xechoochan #kidsmove https://t.co/cyzxa8RF6j','2025-05-15 10:40:23'),('1876101396417655104','xe scooter','kidsmovevn','Kidsmove - Thế giới xe của bé','2025-01-06 10:00:03','0','1','/1094474474/status/1876101396417655104','Chỉ cần một cú đẩy là có thể lướt thật xa!\n\nHôm nay khủng long bé đã sẵn sàng ra ngoài cùng chiếc xe scooter chòi chân màu xanh lá Cooghi yêu thích rồi! 🚲💚\n\n#EmBeDeThuong #MeVaBe #BeYeu #XeChoBe #XeScooter #Cooghi #ThoiTrangTreEm #TreEmDangYeu #CooghiVi